import React, {Component, Fragment} from "react";
import {connect} from "react-redux";
import iniModel from '../models/redux.state.ini';
import Layout from '../components/Layout';
import {activePage} from '../actions/actions'

class Page extends Component {
    static getInitialProps({store, isServer, pathname, query}) {
        store.dispatch(activePage('home')); // component will be able to read from store's state when rendered
        return {state: {...iniModel}}; // you can pass some custom props to component from here
    }

    componentDidMount() {
        console.log(this.props)
    }

    render() {
        return (
            <Fragment>
                <Layout>
                    hello world
                </Layout>
            </Fragment>
        );
    }
}


const stateToProps = state => {
    return {
        ...state
    }
};

export default connect(stateToProps)(Page);
